import React from 'react';

const Contact = () => {
    return (
        <div>
            <p>Let's work together</p>

            <p>See something you like?</p>
            <p>Shoot me an <a href='#'>email</a> if you'd like to collaborate,</p>
        </div>
    )
}

export default Contact;
